  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Nuclear Receptor Signaling Atlas
  (NURSA) is designed to foster the development of a comprehensive understanding of
  the structure, function, and role in disease of nuclear receptors (NRs) and coregulators.
  NURSA seeks to elucidate the roles played by NRs and coregulators in metabolism
  and the development of metabolic disorders (including type 2 diabetes, obesity,
  osteoporosis, and lipid dysregulation), as well as in cardiovascular disease, oncology,
  regenerative medicine and the effects of environmental agents on their actions.</p>n\",\n\t\"license_title\":
